import React from 'react'
import './footer.css'

import { Container, Row , Col, ListGroup, ListGroupItem } from 'reactstrap';
import { Link } from 'react-router-dom';
import logo from '../../assets/images/logo.png'


const quick__links=[
  {
    path:'/home',
    display:'Home'
  },
   
  {
    path:'/about',
    display:'About'
  },
  {
    path:'/tours',
    display:'Tours'
  },

];
const quick__links2=[
  {
    path:'/gallery',
    display:'Gallery'
  },
   
  {
    path:'/login',
    display:'Login'
  },
  {
    path:'/register',
    display:'Register'
  },

]
;
const Footer = () => {
  return (
    <footer className='footer'>
        <Container>
            <Row>
              <Col lg="3">
                 <div className="logo">
                    <img src={logo} alt=''/>
                    <p>
                      Lorem ipsum dolor sit amet consectetur adipisicing elit.
                      Commodi, enim.
                    </p>
                    <div className="social__links d-flex align-items-conter gap-4">
                     <span>
                      <Link tp='#'><i class="ri-youtube-line"></i></Link>
                     </span>
                     <span>
                      <Link tp='#'><i class="ri-github-fill"></i></Link>
                     </span>
                     <span>
                      <Link tp='#'><i class="ri-facebook-circle-line"></i></Link>
                     </span>
                     <span>
                      <Link tp='#'><i class="ri-instagram-line"></i></Link>
                     </span>

                    </div>
                 </div>
              </Col>

              <Col lg='3'>
                 <h5 className="footer__link-title">Discover</h5>
              </Col>
            </Row>
        </Container>
    </footer>
  )
}

export default Footer;
